    if (!status[0] && !status[1] && status[2]) return ["", "", "כן"];

    if (status[0] && status[1] && !status[2]) return ["", "", "לא"];
    if (status[0] && !status[1] && status[2]) return ["", "לא", ""];
    if (!status[0] && status[1] && status[2]) return ["לא", "", ""];

    if (status[0] && status[1] && status[2]) return ["", "", ""];
  }

  const handleFilterChange6mesima = (e) => {
